//song upload
const songupload = document.getElementById('songupload');

songupload.addEventListener('change', function () {
  var files = this.files;

  songname = files[0].name;
  changeS() 

  if(song){
    song.pause();
    song.currentTime = 0;
  }

  song = new Audio();

  song.src = URL.createObjectURL(files[0]);
  song.load();
  song.play();
  soundanalyzer();

  player.classList.remove('fa-play')
  player.classList.add('fa-pause')

  if (bg.style.display === "none") {
    bg.style.display = "block";
    setting.style.display = "block";
  } else {
    bg.style.display = "none";
    setting.style.display = "none";
  }
})


//volume
var volume = document.getElementById('volume');
var cv = document.getElementById('cv')

cv.innerHTML = volume.value;

volume.oninput = function () {
  cv.innerHTML = this.value;
  if (song) {
    song.volume = this.value/100;
  } else {
    cv.innerHTML = 'Song not playing';
    setTimeout(() => {
      cv.innerHTML = ''
    }, 1500)
  }
}


//loop song
var loop = document.getElementById('loop');

loop.addEventListener('click', function () {
  if (loop.innerHTML == 'Loop Song') {
    loop.innerHTML = 'Unloop Song';
    if (song) {
      song.loop = true;
    } else {
      loop.innerHTML = 'Song is not playing...'
      setTimeout(function () {
        loop.innerHTML = 'Loop Song'
      }, 1500)
    }
  } else if (loop.innerHTML == 'Unloop Song'){
    loop.innerHTML = 'Loop Song';
    if (song) {
      song.loop = false;
    } else {
      loop.innerHTML = 'Song is not playing...'
      setTimeout(function () {
        loop.innerHTML = 'Unloop Song'
      }, 2500)
    }
  }
})